import React, { Component } from 'react'

export default class NowPlaying extends Component {
    constructor(props) {
        super(props);
        this.state = {
            playbackState: {
                item: {
                    name: 'Loading'
                }
            }
        }

    }

    componentDidMount() {
        this.props.getPlayback()
        .then(result => {
            this.setState({playbackState: result});
        });
    }

    render() {
        console.log('rendered');
        return (
            <div>
                <div style={{fontFamily: 'Roboto Slab, serif'}}>#NP:</div>
                <div style={{fontFamily: 'Roboto Slab, serif'}}>{this.state.playbackState.item.name}</div>
            </div>
        )
    }
}
